import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { GameIconComponent } from './components/game-icon/game-icon.component';
import { GameIconModule } from './components/game-icon/game-icon.module';



@NgModule({
  declarations: [
    GameIconComponent
  ],
  imports: [
    CommonModule,
    GameIconModule
  ]
})
export class GameOptionsModule { }
